export default class Filter extends Component {
  state={
    currentName:"",
    currentGender:"",
    currentStatus:""
  }
  handleSubmit=(e)=>{
    console.log("Button is Click");
  }
  render() {
    return (
      <div class="filter">
        <h1>Filter</h1>
         <div class="mt-5">
        <form>
          <FilterName currentName={this.state.currentName}></FilterName>
          <FilterGender></FilterGender>
          <FilterStatus></FilterStatus>
          <FilterButton ></FilterButton>
        </form>
      </div>
      </div>
      
     
    );
  }
}
